import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

function AdminDashboardPage() {
  const API_URL = "http://localhost:5000/api";
  const [users, setUsers] = useState([]);
  const [orders, setOrders] = useState([]);
  const [carts, setCarts] = useState([]);
  const [addresses, setAddresses] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const email = localStorage.getItem("email");

    if (email !== "rngasseu123@gmail.com") {
      navigate("/");
      return;
    }

    // Charger tous les éléments
    fetch(`${API_URL}/users?email=${email}`)
      .then((res) => res.json())
      .then((data) => setUsers(data))
      .catch((error) => console.error("Erreur chargement utilisateurs:", error));

    fetch(`${API_URL}/orders?email=${email}`)
      .then((res) => res.json())
      .then((data) => setOrders(data))
      .catch((error) => console.error("Erreur chargement commandes:", error));

    fetch(`${API_URL}/cart?email=${email}`)
      .then((res) => res.json())
      .then((data) => setCarts(data))
      .catch((error) => console.error("Erreur chargement paniers:", error));

    fetch(`${API_URL}/addresses?email=${email}`)
      .then((res) => res.json())
      .then((data) => setAddresses(data))
      .catch((error) => console.error("Erreur chargement adresses:", error));
  }, [navigate]);

  return (
    <div style={{ padding: "20px" }}>
      <h1>Tableau de bord Administrateur</h1>

      {/* Utilisateurs */}
      <section style={{ marginTop: "40px" }}>
        <h2>Utilisateurs</h2>
        {users.length > 0 ? (
          <table style={tableStyle}>
            <thead>
              <tr>
                <th>Nom</th>
                <th>Email</th>
                <th>Rôle</th>
              </tr>
            </thead>
            <tbody>
              {users.map((user) => (
                <tr key={user._id}>
                  <td>{user.name}</td>
                  <td>{user.email}</td>
                  <td>{user.isAdmin ? "Admin" : "Client"}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>Aucun utilisateur trouvé.</p>
        )}
      </section>

      {/* Commandes */}
      <section style={{ marginTop: "40px" }}>
        <h2>Commandes</h2>
        {orders.length > 0 ? (
          <table style={tableStyle}>
            <thead>
              <tr>
                <th>ID Commande</th>
                <th>Total</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {orders.map((order) => (
                <tr key={order._id}>
                  <td>{order._id}</td>
                  <td>{order.totalAmount} €</td>
                  <td>{order.status}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>Aucune commande trouvée.</p>
        )}
      </section>

      {/* Paniers */}
      <section style={{ marginTop: "40px" }}>
        <h2>Paniers</h2>
        {carts.length > 0 ? (
          <table style={tableStyle}>
            <thead>
              <tr>
                <th>ID Panier</th>
                <th>Utilisateur</th>
                <th>Nombre de produits</th>
              </tr>
            </thead>
            <tbody>
              {carts.map((cart) => (
                <tr key={cart._id}>
                  <td>{cart._id}</td>
                  <td>{cart.userId}</td>
                  <td>{cart.products.length}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>Aucun panier trouvé.</p>
        )}
      </section>

      {/* Adresses */}
      <section style={{ marginTop: "40px" }}>
        <h2>Adresses</h2>
        {addresses.length > 0 ? (
          <table style={tableStyle}>
            <thead>
              <tr>
                <th>ID</th>
                <th>Utilisateur</th>
                <th>Adresse</th>
              </tr>
            </thead>
            <tbody>
              {addresses.map((address) => (
                <tr key={address._id}>
                  <td>{address._id}</td>
                  <td>{address.user}</td>
                  <td>
                    {address.street}, {address.city}, {address.postalCode}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>Aucune adresse trouvée.</p>
        )}
      </section>
    </div>
  );
}

const tableStyle = {
  width: "100%",
  borderCollapse: "collapse",
  marginBottom: "20px",
};

export default AdminDashboardPage;
